import {Createbar} from './Navbar';

export function HandleNumInput(props){
	const setPortion = props.func;
	function getInputValue(event){
		// make string to int 
		setPortion(event.target.value * 1);
	};

	return(
		<input type= 'number' onChange={getInputValue}/>
	);
}

